import { useState } from "react";

export default function SignUp() {
    const [formData, setFormData] = useState({
        username: '',
        password: ''
    })

  return (
    <div>
      <form>
        <div>
          <label>Username:</label>
          <input type="text" name="username" />
        </div>
        <div>
            <label>Password:</label>
            <input type="password" name="password" />
        </div>
      </form>
    </div>
  );
}
